import React, { Component } from "react";
import axios from 'axios';



export default class Home extends Component {

  constructor(props) {
    super(props)
    this.state = {
      restaurant: []
    };
  }

  componentDidMount() {
    axios.get('http://localhost:5000/api/restaurant')
      .then(res => {
        this.setState({
            restaurant: res.data
        });
      })
      .catch((error) => {
        console.log(error);
      })
  }

